import React from 'react';
import { Box, Image, Text, VStack } from '@chakra-ui/react';

const HomePage = () => {
  return (
    <VStack spacing={8} align="center" p={5}>
      <Text fontSize="xl" textAlign="center">
        Agriculture is the backbone of our economy, and the health of crops and livestock is critical to ensuring food security and sustainable farming practices. Our portal leverages cutting-edge Artificial Intelligence (AI) to provide farmers with easy-to-use tools for diagnosing and reporting diseases. Whether you're in a remote area or have limited resources, our platform is designed to support you in managing the health of your farm.
      </Text>

      <Image
        src={require("/Users/rohansingh/Desktop/WebDev/LiveStock_Project/frontend/src/Images/risk_prediction_map.jpg")}
        alt="Risk Prediction of Lumpy Skin Diseases"
        boxShadow="lg"
        borderRadius="md"
        maxW="100%"
      />
    </VStack>
  );
};

export default HomePage;
